import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const Id = styled.h1``;

const ExercisePresenter = id => {
  return (
    <div>
      <hi>{id}</hi>
    </div>
  );
};

ExercisePresenter.propTypes = {
  id: PropTypes.string
};

export default ExercisePresenter;
